import React from "react";

function Region() {
    return (
        <div class="content__region__block">
            <ul class="content__region__block__list">
                <li class="region-list" id="africa">Africa</li>
                <li class="region-list" id="america">America</li>
                <li class="region-list" id="asia">Asia</li>
                <li class="region-list" id="europe">Europe</li>
                <li class="region-list" id="oceania">Oceania</li>
            </ul>
        </div>
    )
}

export default Region;
